import Services from './Components/Services';
import CallToAction from './Components/CallToAction';
import { FaQq } from 'react-icons/fa';
const Home = () => {
  return (
    <div>
      <Navbar/>
      <Hero/>
      <About/>
      <Services/>
      <CallToAction/>

    </div>
  )
}

export default Home
